export const TEMPLATE_REGISTRY: Record<string, string> = {
    "prescription-pdf/advice.ejs":
        ' <!-- advices -->\n <% if (prescription.Advices.length) { %>\n <div class="flex flex-col my-4">\n   <% if (!pConfig.hideAdviceTitle) { %>\n   <div class="text-xl mb-2 font-semibold text-black">\n     <%= pConfig.adviceTitle %>\n   </div>\n   <% } %>\n\n   <div class="flex flex-col gap-2">\n     <% prescription.Advices.forEach(function(item, i) { %>\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex flex-wrap items-center gap-x-2.5">\n         <% if (pConfig.adviceListStyle===PILS.BULLET_POINT) { %>\n         <img src="<%= imageThree %>" class="mt-2" />\n         <% } else if (pConfig.adviceListStyle===PILS.NUMBER) { %>\n         <%= i+1 + \'.\' %>\n         <% } %>\n         <%= item.label %>\n       </div>\n     </div>\n     <% }); %>\n   </div>\n </div>\n <% } %>',
    "prescription-pdf/chief-complaint.ejs":
        '<div class="flex flex-col">\n  <% if(prescription.Complaints.length) { %>\n  <div class="flex flex-col mb-4">\n\n    <% if(!pConfig.hideComplaintTitle) { %>\n    <div class="text-xl font-semibold mb-2 text-black">\n      <%= pConfig.complaintTitle %>\n    </div>\n    <% } %>\n\n    <div class="flex flex-col gap-2">\n      <% prescription.Complaints.forEach(function(item, i) { %>\n      <div class="flex flex-col text-base font-normal dark-light leading-5">\n        <div class="flex flex-wrap items-center gap-x-2.5">\n          <% if (pConfig.complaintListStyle===PILS.BULLET_POINT) { %>\n          <img src="<%= imageThree %>" class="mt-2" />\n          <% } else if (pConfig.complaintListStyle===PILS.NUMBER) { %>\n          <span>\n            <%= i+1 %>.\n          </span>\n          <% } %>\n          <%= item.label %>\n          <% if (item.for) { %>\n          <span class="text-sm italic dark">(for <%= item.for %>\n            <%= item.period %>)</span>\n          <% } %>\n        </div>\n        <% if (item.note) { %>\n        <div class="text-sm dark whitespace-pre-line mt-[-0.875rem] ms-5">\n          <%= item.note %>\n        </div>\n        <% } %>\n      </div>\n      <% }); %>\n    </div>\n\n  </div>\n  <% } %>\n</div>',
    "prescription-pdf/diagnosis.ejs":
        '<!-- diagnosis -->\n<div class="flex flex-col">\n  <% if (prescription.Diagnosis?.length) { %>\n  <div class="flex flex-col mb-4">\n    <% if (!pConfig.hideDiagnosisTitle) { %>\n    <div class="text-xl mb-2 font-semibold text-black">\n      <%= pConfig.diagnosisTitle %>\n    </div>\n    <% } %>\n    <div class="flex flex-col gap-2">\n      <% prescription.Diagnosis.forEach(function(item, i) { %>\n      <div class="flex flex-col text-base font-normal dark-light leading-5">\n        <div class="flex flex-wrap items-center gap-x-2.5">\n          <% if (pConfig.diagnosisListStyle==PILS.BULLET_POINT ) { %>\n          <img src="<%= imageThree %>" class="mt-2" />\n          <% } else if (pConfig.diagnosisListStyle==PILS.NUMBER ) { %>\n          <span>\n            <%= i+1 %>.\n          </span>\n          <% } %>\n          <%= item.label %>\n          <% if (item.for) { %>\n          <span class="text-sm italic dark">(for <%= item.for %>\n            <%= item.period %>)</span>\n          <% } %>\n        </div>\n        <% if (item.note) { %>\n        <div class="text-sm dark ml-3">\n          <%= item.note %>\n        </div>\n        <% } %>\n      </div>\n      <% }); %>\n    </div>\n  </div>\n  <% } %>\n</div>',
    "prescription-pdf/distress-levels.ejs":
        '<% if (prescription.DistressLevels && (prescription.DistressLevels.start || prescription.DistressLevels.end || prescription.DistressLevels.start == 0 || prescription.DistressLevels.end == 0)) { %>\n<div class="flex flex-col my-4">\n  <div class="text-xl font-medium mb-1 dark-light">\n    Distress Level\n  </div>\n\n  <div class="flex flex-col gap-2.5">\n    <!-- Start -->\n    <div class="flex flex-col text-sm font-normal dark-light leading-5">\n      <div class="flex items-start gap-x-2.5">\n        <img src="<%= imageThree %>" class="mt-2" />\n        <div class="flex-1 flex items-center gap-2">\n          <div class="text-neutral-800 font-semibold text-base">\n            Start:\n          </div>\n          <div class="text-base text-gray-600 font-normal">\n            <%= prescription.DistressLevels.start %>\n          </div>\n        </div>\n      </div>\n    </div>\n\n    <!-- End -->\n    <div class="flex flex-col text-sm font-normal dark-light leading-5">\n      <div class="flex items-start gap-x-2.5">\n        <img src="<%= imageThree %>" class="mt-2" />\n        <div class="flex-1 flex items-center gap-2">\n          <div class="text-neutral-800 font-semibold text-base">\n            End:\n          </div>\n          <div class="text-base text-gray-600 font-normal">\n            <%= prescription.DistressLevels.end %>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n<% } %>',
    "prescription-pdf/doctor-clinic.ejs":
        '<div class="flex flex-col border-b border-slate-700">\n  <div class="flex">\n    <div class="flex-1 flex flex-col text-left mb-4">\n      <div class="text-primary text-lg font-bold">\n        <%= prescription.Doctor.Name %>\n      </div>\n      <div class="dark-light text-sm font-normal">\n        <%= prescription.Doctor.EducationalQualification %>\n      </div>\n\n\n      <div class="flex flex-col text-primary text-base font-semibold mt-2">\n        <% if(prescription.Doctor.Title) { %>\n        <div>\n          <%= prescription.Doctor.Title %>\n        </div>\n        <% } %>\n\n\n        <% if(prescription.Doctor.Specialties) { %>\n        <div>\n          <%= prescription.Doctor.Specialties %>\n        </div>\n        <% } %>\n      </div>\n\n\n      <div class="dark-extra-light text-sm font-normal">\n        <%= prescription.Doctor.Address %>\n      </div>\n\n      <% if(prescription.Doctor.BMDC) { %>\n      <div class="text-sm font-normal dark-extra-light mt-3">\n        BMDC: <span class="dark font-medium">\n          <%= prescription.Doctor.BMDC %>\n        </span>\n      </div>\n      <% } %>\n\n\n    </div>\n\n    <div class="flex-1 flex flex-col justify-end text-right dark-extra-light mb-4">\n      <% if(pConfig.showClinicInfo && prescription.Clinic) { %>\n      <div class="flex-1 flex flex-col">\n        <% if(prescription.Clinic.Name) { %>\n        <div class="brand-semi-light text-lg font-bold">\n          <%= prescription.Clinic.Name %>\n        </div>\n        <% } %>\n        <% if(prescription.Clinic.Address) { %>\n        <div class="dark-extra-light text-sm font-normal">\n          <%= prescription.Clinic.Address %>\n        </div>\n        <% } %>\n      </div>\n      <% } %>\n\n      <div class="text-sm font-normal">\n        Date: <span class="dart-black">\n          <%= prescription.date %>\n        </span>\n      </div>\n\n      <div class="text-sm font-normal">\n        Time: <span class="dart-black">\n          <%= prescription.time %>\n        </span>\n      </div>\n    </div>\n  </div>\n\n  <div class="divider"></div>\n</div>',
    "prescription-pdf/escalation.ejs":
        '  <% if (prescription.Escalation && (prescription.Escalation.issues.length || prescription.Escalation.details)) { %>\n  <div class="flex flex-col my-4">\n    <div class="text-xl font-medium mb-1 dark-light">Escalation</div>\n\n    <div class="flex flex-col">\n      <!-- distress level -->\n      <% if (prescription.Escalation.issues.length) { %>\n      <div class="flex flex-col text-base font-normal dark-light leading-5">\n        <% prescription.Escalation.issues.forEach(function(issue) { %>\n        <div class="flex items-start gap-x-2.5">\n          <img src="<%= imageThree %>" class="mt-2" />\n          <div class="flex-1 flex items-center gap-2">\n            <div class="text-neutral-800 font-semibold text-base">\n              <%= issue %>\n            </div>\n          </div>\n        </div>\n        <% }) %>\n      </div>\n      <% } %>\n\n      <!-- details -->\n      <% if (prescription.Escalation.details) { %>\n      <div class="flex flex-col text-sm font-normal dark-light leading-5">\n        <div class="flex items-start gap-x-2.5">\n          <img src="<%= imageThree %>" class="mt-2" />\n          <div class="flex-1 flex gap-2">\n            <div class="text-neutral-800 font-semibold text-base">Details:</div>\n\n            <div class="text-base text-gray-600 font-normal">\n              <%= prescription.Escalation.details %>\n            </div>\n          </div>\n        </div>\n      </div>\n      <% } %>\n    </div>\n  </div>\n  <% } %>',
    "prescription-pdf/finding.ejs":
        '<div class="flex flex-col">\n  <% if (prescription.Findings.length) { %>\n  <div class="flex flex-col mb-4">\n    <% if (!pConfig.hideFindingsTitle) { %>\n    <div class="text-xl mb-2 font-semibold text-black">\n      <%= pConfig.findingsTitle %>\n    </div>\n    <% } %>\n    <div class="flex flex-col gap-2">\n      <% prescription.Findings.forEach(function(item, i) { %>\n      <div class="flex flex-col text-base font-normal dark-light leading-5">\n        <div class="flex items-center gap-x-2.5">\n          <% if (pConfig.findingsListStyle==PILS.BULLET_POINT ) { %>\n          <img src="<%= imageThree %>" class="mt-2" />\n          <% } else if (pConfig.findingsListStyle==PILS.NUMBER ) { %>\n          <span>\n            <%= i+1 %>.\n          </span>\n          <% } %>\n          <span><%= item.label %></span>\n        </div>\n        <% if (item.note) { %>\n        <div class="text-sm dark ms-5 whitespace-pre-line mt-[-2.625rem]">\n          <% if (item.query) { %>\n          <span>Query:</span>\n          <% } %>\n          <%= item.note %>\n        </div>\n        <% } %>\n      </div>\n      <% }); %>\n    </div>\n  </div>\n  <% } %>\n</div>',
    "prescription-pdf/followup-tag.ejs":
        ' <% if (!!prescription.FollowupTag.date || prescription.FollowupTag.items.length) { %>\n <div class="flex flex-col">\n   <% if (!pConfig.hideFollowupTitle) { %>\n   <div class="text-xl mb-2 font-semibold text-black">\n     <%= pConfig.followupTitle %>\n   </div>\n   <% } %>\n\n   <div class="flex flex-col gap-2">\n     <% if (prescription.FollowupTag.date) { %>\n     <div class="text-base font-semibold dark-light">\n       <%= prescription.FollowupTag.date %>\n     </div>\n     <% } %>\n\n     <% prescription.FollowupTag.items.forEach(function(item, i) { %>\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex flex-wrap items-center gap-x-2.5">\n         <% if (pConfig.followupListStyle===PILS.BULLET_POINT) { %>\n         <img src="<%= imageThree %>" class="mt-2" />\n         <% } else if (pConfig.followupListStyle===PILS.NUMBER) { %>\n         <%= i+1 + \'.\' %>\n         <% } %>\n         <%= item %>\n       </div>\n     </div>\n     <% }); %>\n   </div>\n </div>\n <% } %>',
    "prescription-pdf/footer.ejs":
        '<div class="fixed bottom-0 right-0 w-full">\n\n  <div class="grid grid-cols-12 items-center">\n\n    <!-- Empty space -->\n    <div class="col-span-2"></div>\n\n    <!-- Signature / Note Section -->\n    <div class="col-span-8 text-center text-[#135556] font-normal text-xs mx-3">\n\n      <% if (isBracEmployee) { %>\n\n      <!-- BRAC Note (centered) -->\n      <div class="text-center">\n        <span class="font-medium">Note: </span>\n        <span class="italic">\n          This is a computer-generated prescription by the doctor.\n          No signature is required. For emergencies, contact us or visit\n          the nearest hospital. BRAC may access this Rx for service and\n          insurance purposes.\n        </span>\n      </div>\n\n      <% } else if (pConfig.signature?.type === SignatureType.NOTE) { %>\n\n      <!-- NOTE type (centered) -->\n      <div class="text-center">\n        <span class="font-medium">Note: </span>\n        <span class="italic">\n          This prescription is generated electronically. No signature is required.\n          Neeramoy acts solely as a platform provider and assumes no responsibility\n          for the treatment and consultation provided by the healthcare provider.\n        </span>\n      </div>\n\n      <% } else { %>\n\n      <!-- Signature (RIGHT aligned) ABOVE the footer block -->\n      <div class="flex justify-end w-full">\n\n        <% if (pConfig.signature?.type === SignatureType.URL && pConfig.signature?.url) { %>\n\n        <img class="w-[12rem] mt-2" src="<%= pConfig.signature?.url %>" alt="Signature" />\n\n        <% } else if (pConfig.signature?.type === SignatureType.TEXT && pConfig.signature?.text?.trim() !== \'\') { %>\n\n        <div class="text-2xl font-normal leading-5 brand-darkest mt-2 signature">\n          <%= pConfig.signature?.text %>\n        </div>\n\n        <% } %>\n\n      </div>\n\n      <% } %>\n\n    </div>\n\n    <!-- Bottom Right Block -->\n    <div class="col-span-2 flex justify-end items-center gap-2.5 my-3">\n\n      <div class="flex items-center gap-1">\n        <img class="w-8" src="<%= imageTwo %>" alt="Neeramoy" />\n        <div class="flex flex-col mt-1">\n          <div class="text-[#303030] text-[12px] font-semibold leading-4">neeramoy</div>\n          <div class="text-[#767676] text-[6px] font-normal leading-3">www.neeramoy.com</div>\n        </div>\n      </div>\n\n      <img class="w-6" src="<%= image %>" alt="QR" />\n\n    </div>\n\n  </div>\n\n</div>',
    "prescription-pdf/history.ejs":
        '<div class="flex flex-col">\n  <% if (prescription.Histories.length) { %>\n  <div class="flex flex-col mb-4">\n    <% if (!pConfig.hideHistoryTitle) { %>\n    <div class="text-xl mb-2 font-semibold text-black">\n      <%= pConfig.historyTitle %>\n    </div>\n    <% } %>\n    <div class="flex flex-col gap-2">\n      <% prescription.Histories.forEach(function(item, i) { %>\n      <div class="flex flex-col text-base font-normal dark-light leading-5">\n        <div class="flex items-center gap-x-2.5">\n          <% if (pConfig.historyListStyle==PILS.BULLET_POINT ) { %>\n          <img src="<%= imageThree %>" class="mt-2" />\n          <% } else if (pConfig.historyListStyle==PILS.NUMBER ) { %>\n          <span>\n            <%= i+1 %>.\n          </span>\n          <% } %>\n          <span><%= item.label %></span>\n          <% if (item.for) { %>\n          <span class="text-sm italic dark">(for <%= item.for %>\n            <%= item.period %>)</span>\n          <% } %>\n        </div>\n        <% if (item.note) { %>\n        <div class="text-sm dark ml-3">\n          <%= item.note %>\n        </div>\n        <% } %>\n      </div>\n      <% }); %>\n    </div>\n  </div>\n  <% } %>\n</div>',
    "prescription-pdf/investigation.ejs":
        ' <!-- investigations -->\n <div class="flex flex-col">\n   <% if (prescription.Investigations.length) { %>\n   <div class="flex flex-col mb-4">\n     <% if (!pConfig.hideInvestigationTitle) { %>\n     <div class="text-xl mb-2 font-semibold text-black">\n       <%= pConfig.investigationTitle %>\n     </div>\n     <% } %>\n\n     <div class="flex flex-col gap-2">\n       <% prescription.Investigations.forEach(function(item, i) { %>\n       <div class="flex flex-col text-base font-normal dark-light leading-5">\n         <div class="flex flex-wrap items-center gap-x-2.5">\n           <% if (pConfig.investigationListStyle===PILS.BULLET_POINT) { %>\n           <img src="<%= imageThree %>" alt="bullet point" />\n           <% } %>\n\n           <% if (pConfig.investigationListStyle===PILS.NUMBER) { %>\n           <span>\n             <%= i+1 %>.\n           </span>\n           <% } %>\n\n           <%= item.label %>\n\n           <% if (item.instruction) { %>\n           <span class="text-sm italic dark">\n             (<%= item.instruction %>)\n           </span>\n           <% } %>\n         </div>\n\n         <% if (item.result) { %>\n         <div class="text-sm dark ml-3">\n           <span>Result:</span>\n           <%= item.result %>\n         </div>\n         <% } %>\n       </div>\n       <% }) %>\n     </div>\n   </div>\n   <% } %>\n </div>',
    "prescription-pdf/medicine.ejs":
        '<div class="flex flex-col">\n  <!-- v2 Prescription -->\n  <% if (prescription.MedicineTag.items.length) { %>\n  <div class="flex flex-col mb-2">\n    <% if (!pConfig.hideMedicineTitle) { %>\n    <div class="text-xl mb-2 font-semibold text-black">\n      <%= pConfig.medicineTitle %>\n    </div>\n    <% } %>\n\n    <div class="flex flex-col gap-4">\n      <% for (let i=0; i < prescription.MedicineTag.items.length; i++) { %>\n      <% let med=prescription.MedicineTag.items[i]; %>\n      <div class="flex">\n        <% if (pConfig.medicineListStyle===PILS.BULLET_POINT) { %>\n        <div class="pt-2 pr-2">\n          <img src="<%= imageThree %>" class="mt-2" />\n        </div>\n        <% } %>\n\n        <% if (pConfig.medicineListStyle===PILS.NUMBER) { %>\n        <div class="text-base font-medium text-neutral-800 mr-2 leading-6">\n          <%= i+1 + \'. \' %>\n        </div>\n        <% } %>\n\n        <div class="flex-1 flex flex-col">\n          <div class="flex items-center text-base font-normal text-neutral-800 gap-x-2.5 leading-6">\n            <% if (med.type) { %>\n            <span class="font-normal">\n              <%= med.type %>.</span>\n            <% } %>\n            <span class="font-semibold text-black">\n              <%= med.drug %>\n            </span>\n            <% if (med.quantity) { %>\n            <span>-------</span>\n            <% } %>\n\n\n            <% if (med.quantity) { %>\n            <span class="flex gap-1 font-medium">\n              <span><%- med.fractionalTemplateQuantity %></span>\n              <%= med.quantityType %>\n            </span>\n            <% } %>\n          </div>\n\n\n          <div class="flex flex-wrap items-center text-sm font-normal dark-light gap-x-2.5 leading-4">\n            <% if (med.doseAmount && isV2Prescription) { %>\n            <span class="flex gap-1">\n              <span><%- med.fractionalTemplateDoseAmount %></span>\n              <%= med.doseType %>\n            </span>\n            <% } %>\n            <% if (med.doseAmount && med.schedule && isV2Prescription) { %>\n            <span>x</span>\n            <% } %>\n\n\n\n            <% if (med.schedule && isV2Prescription) { %>\n            <span class="flex gap-1">\n              <span><%- med.fractionalTemplateSchedule %></span>\n              <%= med.scheduleType %>\n            </span>\n            <% } %>\n\n\n            <% if (med.schedules && !isV2Prescription) { %>\n            <span class="flex gap-1">\n              <%- med.parseSchedules %> <% if (med.doseType) { %> (<%= med.doseType %>) <% } %>\n            </span>\n            <% } %>\n            <% if (med.remark) { %>\n            <span>-------</span>\n            <span>\n              <%= med.remark %>\n            </span>\n            <% } %>\n\n\n            <% if (med.duration) { %>\n            <span>-------</span>\n            <span class="flex gap-1">\n              <span><%- med.fractionalTemplateDuration\n                                                                            %></span>\n              <%= med.durationType %>\n            </span>\n            <% } %>\n\n            <% if (med.continuousDuration) { %>\n            <span>-------</span>\n            <span class="flex gap-1">\n              চলবে\n            </span>\n            <% } %>\n          </div>\n          <% if (!!med.note) { %>\n          <div class="text-xs text-black leading-4">\n            <span class="italic">Note:</span>\n            <%= med.note %>\n          </div>\n          <% } %>\n        </div>\n      </div>\n\n      <% } %>\n      <% if (prescription.MedicineTag.continuePrevious) { %>\n      <div class="continue-medicine">\n        <div class="text-sm font-medium text-primary">আগের ওষুধ চলবে...</div>\n      </div>\n      <% } %>\n    </div>\n  </div>\n  <% } %>\n</div>',
    "prescription-pdf/on-examination.ejs":
        '<!-- on examination start here -->\n\n<div class="flex flex-col">\n  <% if (prescription.OnExamination && prescription.OnExaminationKeys?.length) { %>\n  <div class="flex flex-col mb-4">\n    <% if (!pConfig.hideOnExaminationTitle) { %>\n    <div class="text-xl mb-2 font-semibold text-black">\n      <%= pConfig.onExaminationTitle %>\n    </div>\n    <% } %>\n\n    <div class="flex flex-col gap-2">\n      <% for (let index = 0; index < prescription.OnExaminationKeys.length; index++) { %>\n      <% const key = prescription.OnExaminationKeys[index]; %>\n      <div class="flex flex-col text-base font-normal dark-light leading-5">\n        <div class="flex items-start gap-x-2.5">\n          <% if (pConfig.onExaminationListStyle === PILS.BULLET_POINT) { %>\n          <img src="<%= imageThree %>" alt="bullet point" class="mt-2" />\n          <% } else if (pConfig.onExaminationListStyle === PILS.NUMBER) { %>\n          <span><%= index + 1 + "." %></span>\n          <% } %>\n\n          <% if (key === \'bmi\') { %>\n          <div class="bmi w-100">\n            <span class="key">BMI:</span>\n            <span class="value text-dark font-medium">\n              <%= prescription.OnExamination[key]?.bmi %>\n              <span class="special-note" <% if (prescription.OnExamination[key]?.specialNote) { %>>(<%= prescription.OnExamination[key]?.specialNote %>)<% } %></span>\n            </span>\n          </div>\n          <% } else if (key === \'pregnancyCalendar\') { %>\n          <div class="pregnancy-data">\n            <span class="key">Pregnancy:</span>\n            <span class="value text-dark font-medium">\n              <%= prescription.OnExamination.pregnancyCalendar?.currently %>\n              <span class="special-note" <% if (prescription.OnExamination[key]?.specialNote) { %>>(<%= prescription.OnExamination[key]?.specialNote %>)<% } %></span>\n            </span>\n          </div>\n          <% } else if (key === \'temperature\' || key === \'pulse\') { %>\n          <div class="temperate-or-pulse">\n            <span class="key"><%= prescription.OnExaminationEnum[key] %>:</span>\n            <span class="value text-dark font-medium">\n              <%= prescription.OnExamination[key]?.value %> <%= prescription.OnExamination[key]?.type %>\n              <span class="special-note" <% if (prescription.OnExamination[key]?.specialNote) { %>>(<%= prescription.OnExamination[key]?.specialNote %>)<% } %></span>\n            </span>\n          </div>\n          <% } else if ([\'hypertension\', \'heartDisease\', \'kidneyDisease\', \'asthma\', \'hyperlipidemia\', \'backPain\', \'cancer\', \'diabetesMellitus\', \'lactating\',\'pregnancy\', \'liverDisease\'].includes(key)) { %>\n          <div class="yes-no-model">\n            <span class="key"><%=  prescription.OnExaminationEnum[key]  %>:</span>\n            <span class="value text-dark font-medium">\n              <%= prescription.OnExamination[key]?.isActive ? "Yes" : "No" %>\n              <span class="special-note" <% if (prescription.OnExamination[key]?.specialNote) { %>>(<%= prescription.OnExamination[key]?.specialNote %>)<% } %></span>\n            </span>\n          </div>\n          <% } else if (key === \'extraNote\') { %>\n          <div class="extra-data">\n            <span class="key">Special Note:</span>\n            <span class="value text-dark font-medium">\n              <%= prescription.OnExamination?.extraNote %>\n            </span>\n          </div>\n          <% } %>\n        </div>\n      </div>\n      <% } %>\n      <div class="flex flex-col gap-2">\n        <% if (prescription.OnExamination?.extraFields) { %>\n        <% for (let i = 0; i < prescription.OnExamination.extraFields.length || 0; i++) { %>\n        <% const extraField = prescription.OnExamination.extraFields[i]; %>\n        <div class="flex flex-col text-base font-normal dark-light leading-5">\n          <div class="flex items-start gap-x-2.5">\n            <% if (pConfig.onExaminationListStyle === PILS.BULLET_POINT) { %>\n            <img src="<%= imageThree %>" alt="bullet point" class="mt-2" />\n            <% } else if (pConfig.onExaminationListStyle === PILS.NUMBER) { %>\n            <span><%=  prescription.OnExaminationKeys.length + i + 1 + "." %></span>\n            <% } %>\n\n            <div class="extra-fields">\n              <span class="key"><%= extraField.fieldName %>:</span>\n              <span class="value text-dark font-medium"><%= extraField.fieldValue %></span>\n            </div>\n          </div>\n        </div>\n        <% } %>\n        <% } %>\n      </div>\n    </div>\n  </div>\n  <% } %>\n</div>\n\n<!-- on examination ends here -->',
    "prescription-pdf/patient-area.ejs":
        ' <% if (prescription.PatientArea && (prescription.PatientArea.division || prescription.PatientArea.details)) { %>\n <div class="flex flex-col my-4">\n   <div class="text-xl font-medium mb-1 dark-light">Client Area</div>\n\n   <div class="flex flex-col gap-2.5">\n     <!-- Division -->\n     <% if(prescription.PatientArea.division) { %>\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex items-start gap-x-2.5">\n         <img src="<%= imageThree %>" class="mt-2" />\n         <div class="flex-1 flex items-center gap-2">\n           <div class="text-neutral-800 font-semibold text-base">\n             Division:\n           </div>\n           <div class="text-base text-gray-600 font-normal">\n             <%= prescription.PatientArea.division %>\n           </div>\n         </div>\n       </div>\n     </div>\n     <% } %>\n\n     <!-- District -->\n     <% if(prescription.PatientArea.district) { %>\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex items-start gap-x-2.5">\n         <img src="<%= imageThree %>" class="mt-2" />\n         <div class="flex-1 flex items-center gap-2">\n           <div class="text-neutral-800 font-semibold text-base">\n             District:\n           </div>\n           <div class="text-base text-gray-600 font-normal">\n             <%= prescription.PatientArea.district %>\n           </div>\n         </div>\n       </div>\n     </div>\n     <% } %>\n\n     <!-- Upazila -->\n     <% if(prescription.PatientArea.upazila) { %>\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex items-start gap-x-2.5">\n         <img src="<%= imageThree %>" class="mt-2" />\n         <div class="flex-1 flex items-center gap-2">\n           <div class="text-neutral-800 font-semibold text-base">\n             Upazila:\n           </div>\n           <div class="text-base text-gray-600 font-normal">\n             <%= prescription.PatientArea.upazila %>\n           </div>\n         </div>\n       </div>\n     </div>\n     <% } %>\n\n     <!-- Details -->\n     <% if(prescription.PatientArea.details) { %>\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex items-start gap-x-2.5">\n         <img src="<%= imageThree %>" class="mt-2" />\n         <div class="flex-1 flex items-center gap-2">\n           <div class="text-neutral-800 font-semibold text-base">\n             Details:\n           </div>\n           <div class="text-base text-gray-600 font-normal">\n             <%= prescription.PatientArea.details %>\n           </div>\n         </div>\n       </div>\n     </div>\n     <% } %>\n   </div>\n </div>\n <% } %>',
    "prescription-pdf/patient.ejs":
        '<div class="grid grid-cols-4 justify-between py-2.5 border-b border-slate-700">\n  <div class="text-base dark-light font-medium">\n    <% if (isPsychologist) { %>\n    Client:\n    <% } else { %>\n    Patient:\n    <% } %>\n    <span class="dart-mid-dark font-normal ml-1">\n      <%= prescription.Patient.Name %>\n    </span>\n  </div>\n\n  <% if(!pConfig.hideAge) { %>\n  <div class="text-base dark-light font-medium">\n    Age: <span class="dart-mid-dark font-normal ml-1">\n      <%= prescription.Patient.Age || \'NA\' %>\n    </span>\n  </div>\n  <% } %>\n\n\n  <% if(!pConfig.hideGender) { %>\n  <div class="text-base dark-light font-medium">\n    Gender: <span class="dart-mid-dark font-normal ml-1">\n      <%= prescription.Patient.Gender %>\n    </span>\n  </div>\n  <% } %>\n\n  <% if(!pConfig.hideBloodGroup  && prescription.Patient.BloodGroup) { %>\n  <div class="text-base dark-light font-medium">\n    BG: <span class="dart-mid-dark font-normal ml-1">\n      <%= prescription.Patient.BloodGroup || "" %>\n    </span>\n  </div>\n  <% } %>\n\n\n\n  <div class="text-base dark-light font-medium">\n    ID:<span class="dart-mid-dark font-normal ml-1">\n      <%= patientShortId %>\n    </span>\n  </div>\n\n\n  <% if(prescription.Patient.EmployeeId) { %>\n  <div class="text-base dark-light font-medium">\n    EID: <span class="dart-mid-dark font-normal ml-1">\n      <%= prescription.Patient.EmployeeId %>\n    </span>\n  </div>\n  <% } %>\n\n  <% if(pConfig.showDateTime) { %>\n\n  <div class="text-base dark-light font-medium me-3">\n    Date: <span class="dart-mid-dark font-normal ml-1">\n      <%= prescription.date %>\n    </span>\n  </div>\n  <div class="text-base dark-light font-medium">\n    Time: <span class="dart-mid-dark font-normal ml-1">\n      <%= prescription.time %>\n    </span>\n  </div>\n\n  <% } %>\n\n\n\n\n</div>',
    "prescription-pdf/reffered-to.ejs":
        ' <!-- advices -->\n <% if (prescription.RefferedTo?.referralType || prescription.refferedTo?.division) { %>\n <div class="flex flex-col my-4">\n   <div class="text-xl mb-2 font-semibold text-black">Reffered To</div>\n   <div class="flex flex-col gap-2">\n\n     <% if (prescription.RefferedTo?.division){ %>\n     <!-- Division -->\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex items-start gap-x-2.5">\n         <img src="<%= imageThree %>" class="mt-2" />\n         <div class="flex-1 flex items-center gap-2">\n           <div class="text-neutral-800 font-semibold text-base">\n             Division:\n           </div>\n           <div class="text-base text-gray-600 font-normal">\n             <%= prescription.RefferedTo.division %>\n           </div>\n         </div>\n       </div>\n     </div>\n     <% } %>\n\n     <% if (prescription.RefferedTo?.referralType){ %>\n     <!-- ReferralType -->\n     <div class="flex flex-col text-sm font-normal dark-light leading-5">\n       <div class="flex items-start gap-x-2.5">\n         <img src="<%= imageThree %>" class="mt-2" />\n         <div class="flex-1 flex items-center gap-2">\n           <div class="text-neutral-800 font-semibold text-base">\n             Referral Type:\n           </div>\n           <div class="text-base text-gray-600 font-normal">\n             <%= prescription.RefferedTo.referralType %>\n           </div>\n         </div>\n       </div>\n     </div>\n     <% } %>\n\n   </div>\n </div>\n <% } %>',
    "prescription-pdf/treatment-plan.ejs":
        ' <!-- Treatment plan -->\n <div class="flex flex-col">\n   <% if (prescription.TreatmentPlans?.length) { %>\n   <div class="flex flex-col mb-4">\n     <% if (!pConfig.hideTreatmentPlanTitle) { %>\n     <div class="text-xl font-medium mb-1 dark-light">\n       <%= pConfig.treatmentPlanTitle %>\n     </div>\n     <% } %>\n     <div class="flex flex-col gap-2">\n       <% prescription.TreatmentPlans.forEach(function(item, i) { %>\n       <div class="flex flex-col text-base font-normal dark-light leading-5">\n         <div class="flex flex-wrap items-center gap-x-2.5">\n           <% if (pConfig.treatmentPlanListStyle==PILS.BULLET_POINT ) { %>\n           <img src="<%= imageThree %>" class="mt-2" />\n           <% } else if (pConfig.treatmentPlanListStyle==PILS.NUMBER ) { %>\n           <span>\n             <%= i+1 %>.\n           </span>\n           <% } %>\n           <%= item.label %>\n           <% if (item.for) { %>\n           <span class="text-sm italic dark">(for <%= item.for %>\n             <%= item.period %>)</span>\n           <% } %>\n         </div>\n         <% if (item.note) { %>\n         <div class="text-sm dark ml-3">\n           <%= item.note %>\n         </div>\n         <% } %>\n       </div>\n       <% }); %>\n     </div>\n   </div>\n   <% } %>\n </div>',
    "prescription-pdf/well-being.ejs":
        '<% if (prescription.WellBeing && (prescription.WellBeing.questionAndAnswers.length || prescription.WellBeing.result)) { %>\n<div class="flex flex-col my-4">\n  <div class="text-xl font-medium mb-1 dark-light">\n    Wellbeing Scale Score\n  </div>\n  <div class="flex flex-col gap-2 mt-2">\n\n    <% prescription.WellBeing.questionAndAnswers.forEach(function(questionAnswer) { %>\n    <div class="flex gap-x-2.5">\n      <div>\n        <img src="<%= imageThree %>" class="mt-2" />\n      </div>\n      <div class="flex flex-col">\n        <div class="font-medium text-base font-quicksand text-black">\n          <%= questionAnswer.question %>\n        </div>\n        <div class="text-base text-gray-700 font-roboto font-normal">\n          <%= questionAnswer.answer %>\n        </div>\n      </div>\n    </div>\n    <% }) %>\n\n    <% if (prescription.WellBeing.result) { %>\n    <div class="flex flex-col">\n      <div class="text-primary underline font-roboto font-semibold text-base">\n        Result\n      </div>\n\n      <div class="text-gray-500 font-quicksand font-medium">\n        ওয়েলবিং\n        <%= prescription.WellBeing.result < 50 ? "খারাপ" : "ভাল" %>\n        (রেজাল্ট ৫০% এর\n        <%= prescription.WellBeing.result < 50 ? "কম" : "অধিক" %>)\n      </div>\n    </div>\n    <% } %>\n  </div>\n</div>\n<% } %>',
    "prescription-pdf.ejs":
        "<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n  <meta charset=\"UTF-8\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n  <title>Prescription PDF</title>\n  <link rel=\"preconnect\" href=\"https://fonts.googleapis.com\">\n  <link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin>\n  <link href=\"https://fonts.googleapis.com/css2?family=Anek+Bangla:wdth,wght@75..125,100..800&family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap\" rel=\"stylesheet\">\n  <script src=\"https://cdn.tailwindcss.com\"></script>\n  <script>\n    tailwind.config = {\n      theme: {\n        extend: {\n          colors: {\n            primary: {\n              light: \"#429394\",\n              DEFAULT: \"#357a7b\",\n              dark: \"#135556\"\n            }\n          }\n        }\n      }\n    }\n  </script>\n  <style>\n    /* Embed Anek Bangla Variable Font */\n    @font-face {\n      font-family: 'Anek Bangla';\n      src: url('<%= fontAnekBangla %>') format('truetype-variations');\n      font-weight: 100 800;\n      font-stretch: 75% 125%;\n      font-style: normal;\n      font-display: block;\n    }\n\n    body {\n      /* Anek Bangla is now the primary and only font */\n      font-family: \"Anek Bangla\", sans-serif !important;\n      margin: 0;\n      padding: 0;\n    }\n\n    html {\n      font-size: <%=pConfig.baseFontSize || 12 %>px;\n    }\n\n    @media print {\n      @page {\n        size: A4;\n        margin: 0 !important;\n      }\n\n      body {\n        /* Use Padding to simulate margins and clear browser headers/footers */\n        padding-top: <%=(pConfig.isHeaderBlank && pConfig.headerHeight) ? pConfig.headerHeight + 'px': (pConfig.margin?.top ? pConfig.margin.top + 'cm' : '1cm') %>;\n        padding-bottom: <%=pConfig.margin?.bottom ? pConfig.margin.bottom + 'cm': '1cm'%>;\n        padding-left: <%=pConfig.margin?.left ? pConfig.margin.left + 'cm': '1cm'%>;\n        padding-right: <%=pConfig.margin?.right ? pConfig.margin.right + 'cm': '1cm'%>;\n\n        -webkit-print-color-adjust: exact;\n        print-color-adjust: exact;\n      }\n    }\n\n    .prescription-wrap {\n      width: 100%;\n      display: flex;\n      flex-direction: column;\n    }\n  </style>\n</head>\n\n<body>\n  <div class=\"flex flex-col\" id=\"print-section\">\n    <div class=\"prescription-wrap\">\n      <% if (!pConfig.isHeaderBlank) { %>\n      <%- include('./prescription-pdf/doctor-clinic.ejs') %>\n      <% } %>\n\n      <%- include('./prescription-pdf/patient.ejs') %>\n\n      <div class=\"grid grid-cols-12 gap-5 mt-5 divide-x divide-slate-700\">\n        <div class=\"col-span-5 flex flex-col gap-3\">\n          <%- include('./prescription-pdf/patient-area.ejs') %>\n          <%- include('./prescription-pdf/chief-complaint.ejs') %>\n          <%- include('./prescription-pdf/history.ejs') %>\n          <%- include('./prescription-pdf/on-examination.ejs') %>\n          <%- include('./prescription-pdf/distress-levels.ejs') %>\n          <%- include('./prescription-pdf/finding.ejs') %>\n          <%- include('./prescription-pdf/diagnosis.ejs') %>\n          <%- include('./prescription-pdf/investigation.ejs') %>\n        </div>\n\n        <div class=\"col-span-7 pl-5 flex flex-col gap-3\">\n          <%- include('./prescription-pdf/medicine.ejs') %>\n          <%- include('./prescription-pdf/well-being.ejs') %>\n          <%- include('./prescription-pdf/treatment-plan.ejs') %>\n          <%- include('./prescription-pdf/advice.ejs') %>\n          <%- include('./prescription-pdf/escalation.ejs') %>\n          <%- include('./prescription-pdf/followup-tag.ejs') %>\n          <%- include('./prescription-pdf/reffered-to.ejs') %>\n        </div>\n      </div>\n      <%- include('./prescription-pdf/footer.ejs') %>\n    </div>\n  </div>\n</body>\n\n</html>"
}
